import React from 'react';

const ProjectCard = (props) => {
    return (
        <div className='bg-[#EAE7E7] bg-opacity-35 md:p-6 p-8 w-[45rem] rounded-[1rem] ml-[4rem] border-2'> 
            
            {/* Inner object div */}
            <div className='flex  justify-center items-center'>

                {/* Image */}
                <div className='bg-white rounded-[1.6rem] justify-center items-center w-[25rem] '>
                    <img className='rounded-[0.8rem] border-2 border-white' src={props.mainimg} alt="" srcset="" />
                </div>

                {/* Text */}
                <div className='p-6 pl-[2.5rem] w-[35rem]'>
                    <p className='opacity-80 font-montserrat  font-extrabold text-2xl tracking-tight '>{props.projectname}</p>
                    <p className='font-montserrat text-black font-medium opacity-50 text-[0.8rem]  tracking-tight '>{props.projecttech}</p>
                    <p className='font-montserrat opacity-65 font-normal text-[0.8rem] pt-[0.8rem] tracking-tight'>{props.projectdesc}</p>
                    <div className='flex gap-8 mt-[1.5rem]'>
                    <button className=" bg-[#2229D8] opacity-75 font-bold text-[1rem]  text-center px-[2.5rem] py-[0.4rem] rounded-[0.25rem] text-white">{props.buttonname} <span><img className=" inline-block w-100%  " src="./github.svg"  alt="" /></span></button>
                    <button className=" border-2 border-[#2229D8] text-[#2229D8]  opacity-75 font-bold text-[1rem] text-center px-[2.5rem] py-[0.4rem] rounded-[0.2rem]">{props.buttonname2} <span><img className=" inline-block w-100% h-6" src={props.buttonimg2} alt="" /></span></button>
                    </div>

                </div>


            </div>

        </div>
    );
}

export default ProjectCard;
